import React from 'react'
import DataTable from 'react-data-table-component';
import Avatar from '../../images/avatar.png'

const columns = [
    {
        name: 'ID',
        selector: row => row.unique_id,
    },
    {
        name: 'Names',
        selector: (row) => <div className="user_info">
        <img src={Avatar} alt="" />
        <div className="name"><b>{row.names}</b></div>
        <div className="address"><small>{row.address}</small></div>
      </div>,
    },
    {
        name: 'Flight Risk',
        selector: (row) => <div className='status_wrap'><span className='status red'></span></div>,
    },
    {
        name: 'Monday',
        selector: row => row.day,
    },
    {
        name: 'Monday',
        selector: row => row.day,
    },
    {
        name: 'Tuesday',
        selector: row => row.day,
    },
    {
        name: 'Wednesday',
        selector: row => row.day,
    },
    {
        name: 'Thursday',
        selector: row => row.day,
    },
    {
        name: 'Friday',
        selector: row => row.day,
    },
    {
        name: 'Saturday',
        selector: row => row.day,
    },
    {
        name: 'Sunday',
        selector: row => row.day,
    },
];

const data = [
    {
        id: 1,
        unique_id: 'Beetlejuice',
        names: 'Jamal K',
        address: '263 Ossington Ove',
        image: Avatar
    },

]


const OrderTable  = () => {
  return (
    <>
    <DataTable
            columns={columns}
            data={data}
            selectableRows
        />
    </>
  )
}

export default OrderTable
